const app = new Clarifai.App({
  apiKey: 'c2ca6af3389843568c965d79e34c7133'
 });  


class  App extends Component {
  constructor() {
    super(); 
    this.state = { input:'', imgUrl:'',}
  }

  whenInputChange = (event) => {
     console.log(event.target.value); 
  }

  whenSubmit = () => {
    console.log('btn has been clicked!');
    app.models.predict(Clarifai.COLOR_MODEL, "https://samples.clarifai.com/face-det.jpg").then(
      function(response){
         console.log(response); 
      }, 
      function(error){

      }
    );
  }

  render (){
  return (
    <div className="App">
       <Particles className='particles' params={{particles: {number: {value:100, desity: {enable:true, value_area:50 }}}}} />     
       <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm whenInputChange={this.whenInputChange} whenSubmit={this.whenSubmit} />
      <FaceRecognition />
    </div>
  );
}
}

export default App;
